package com.mzth.createcause.model.user.impl;import com.mzth.createcause.entity.InComeInfo;import com.mzth.createcause.model.user.IInComeInfo;import java.util.ArrayList;import java.util.List;/** * Created by 收入明细 on 2017/10/16 0016. */public class InComeModel implements IInComeInfo {    private static IInComeInfo mIInComeInfo;    private InComeModel() {    }    public static IInComeInfo getIInComeInfo(){        if(mIInComeInfo==null){            mIInComeInfo=new InComeModel();        }        return mIInComeInfo;    }    @Override    public List<InComeInfo> getInComeList() {        List<InComeInfo> mInComeInfos = new ArrayList<>();        String[] titles = new String[]{                "分享文章",                "发布文章",                "邀请会员",                "外门弟子",                "搜索引擎"        };        for (int i = 0; i < titles.length; i++) {            InComeInfo mInComeInfo = new InComeInfo();            mInComeInfo.setTitle(titles[i]);            mInComeInfo.setCound("1000");            mInComeInfos.add(mInComeInfo);        }        return mInComeInfos;    }}